import Cors from "cors";
import axios from "axios";
import initMiddleware from "../../lib/init-middleware";

// Initialize the cors middleware
const cors = initMiddleware(
  Cors({
    // Only allow requests with GET, POST and PUT
    methods: ["GET", "POST", "PUT"],
  })
);

export default async (req, res) => {
  // Run cors
  await cors(req, res);

  const signedUrl =
    "https://wellick-lease-image-s3-stage.s3.amazonaws.com/lease-image-1-1600801947234?AWSAccessKeyId=AKIAWQRXSB72EUDRGGZB&Expires=1600804947&Signature=td91TsTLE3LKoEf6%2FwHbVj78J4w%3D";

  console.log(req.body);

  // let res2;
  // if (body) {
  //   const res2 = await axios.put(signedUrl, file);
  // }
  // console.log({ res2 });
  res.json({ success: "true" });
};
